info.description:
The Church Management System (ChMS) is an application that helps in managing of Church members, groups, events, assets, mass communication and finances (tithes, offerings, donations, seeds etc).

# Modules

## 1. Church Administration (_in progress_)
This manages the Church Hierarchy, Head Church, Churches at different levels and Church Leads, Groups and Sub-Groups.
This has the folowing Sub-Modules and endpoints:

### 1.1 Herarchy Sub-Module
<input type="checkbox" checked> Get All Hierarchies &nbsp;
<input type="checkbox" checked> Get Hierarchy by Code &nbsp;
<input type="checkbox" checked> Activate Hierarchy by Code &nbsp;
<input type="checkbox" checked> Deactivate Hierarchy by Code &nbsp;
<input type="checkbox" checked> Update Hierarchy by Code &nbsp;
<hr>

### 1.2 Head Church Sub-Module
<input type="checkbox" checked> Create New Head Church &nbsp;
<input type="checkbox" checked> Get Head Church by Code &nbsp;
<input type="checkbox" checked> Update Head Church by Code &nbsp;
<input type="checkbox" checked> Activate Head Church by Code (Super Admin only) &nbsp;
<input type="checkbox" checked> Deactivate Head Church by Code (Super Admin only) &nbsp;
<hr>

### 1.3 Churches Sub-Module
<input type="checkbox" checked> Create New Church &nbsp;
<input type="checkbox" checked> Approved Church by Code &nbsp;
<input type="checkbox" checked> Get All Churches &nbsp;
<input type="checkbox" checked> Get Churches by Level &nbsp;
<input type="checkbox" checked> Get Church by Code &nbsp;
<input type="checkbox" checked> Update Church by Code &nbsp;
<input type="checkbox" checked> Activate Church by Code &nbsp;
<input type="checkbox" checked> Deactivate Church by Code &nbsp;
<hr>

### 1.4 Church Leads Sub-Module
<input type="checkbox" checked> Get Church Leads by Code &nbsp;
<input type="checkbox" checked> Unmap Church Leads by Code &nbsp;
<input type="checkbox" checked> Map Church Leads by Code &nbsp;
<input type="checkbox" checked> Get Churches by Lead Code &nbsp;
<hr>

### 1.5 Groups Sub-Module
<input type="checkbox" unchecked disabled> Create New Group &nbsp;
<input type="checkbox" unchecked disabled> Get All Groups &nbsp;
<input type="checkbox" unchecked disabled> Get Group by Code &nbsp;
<input type="checkbox" unchecked disabled> Get Group by Church Code &nbsp;
<input type="checkbox" unchecked disabled> Get Groups by Level Code &nbsp;
<input type="checkbox" unchecked disabled> Update Group by Code &nbsp;
<input type="checkbox" unchecked disabled> Activate Group by Code &nbsp;
<input type="checkbox" unchecked disabled> Deactivate Group by Code &nbsp;
<hr>
<br>

## 2. Members Management (_in progress_) 
This manages Members, Church Positions, Member Positions.

### 2.1 Members Sub-Module
<input type="checkbox" checked> Create New Member &nbsp;
<input type="checkbox" checked> Get All Members &nbsp;
<input type="checkbox" checked> Get Member by Code &nbsp;
<input type="checkbox" checked> Get Current User Member &nbsp;
<input type="checkbox" checked> Get Members by Church Code &nbsp;
<input type="checkbox" checked> Get Members by Level Code &nbsp;
<input type="checkbox" checked> Update Member by Code &nbsp;
<input type="checkbox" checked> Update Current User Member &nbsp;
<input type="checkbox" checked> Activate Member by Code &nbsp;
<input type="checkbox" checked> Deactivate Member by Code &nbsp;
<hr>
<br>

### 2.2 Member Positions Sub-Module
<input type="checkbox" unchecked disabled> Create New Member Position &nbsp;
<input type="checkbox" unchecked disabled> Get All Member Positions &nbsp;
<input type="checkbox" unchecked disabled> Get Member Position by Code &nbsp;
<input type="checkbox" unchecked disabled> Get Member Positions by Member Code &nbsp;
<input type="checkbox" unchecked disabled> Update Member Position by Code &nbsp;
<input type="checkbox" unchecked disabled> Activate Member Position by Code &nbsp;
<input type="checkbox" unchecked disabled> Deactivate Member Position by Code &nbsp;
<hr>
<br>


## 3. User Management (_in progress_)
This managers users, user roles, user access to modules and submodules.

## 4. Asset Management (_not implemented_)
This manages assets, asset types, assets allocation and locations.

## 5. Event Management (_not implemented_)
This manages program events and events details.

## 6. Finance Management (_not implemented_)
This manages tithes, offerings, donations, seeds etc.

## 7. Communication Management (_not implemented_)
This manages all communication channels and messages.

<br>


Contact Support:
 Name: Gregory Ogbemudia
 Email: gregory.ogbemduia@gmail.com

